import React from "react";

const Slider = () => {
  return (
    <div className="container">
      <div className="rows d-flex flex-row">
        <div className="col-6 bg-dark">1</div>
        <div className="col-6 bg-white">2</div>
        <div className="col-6 bg-primary">3</div>
        <div className="col-6 bg-dark">4</div>
      </div>
    </div>
  );
};

export default Slider;
